import { configureStore, createSlice } from "@reduxjs/toolkit";

import employeesReducer from "./employees";

let user = createSlice({
  name: "user",
  initialState: "you-eunkyung",
});

export default configureStore({
  reducer: {
    user: user.reducer,
    employees: employeesReducer,
  },
});
